import React, { useEffect } from 'react'
import './AutoWizard.css';

import { connect } from 'react-redux';
import { setWizardIntentType } from '../../../redux/actions/wizardActions';

import {
    Row,
    Col
} from 'react-bootstrap';

import {
    Link,
    Redirect,
} from 'react-router-dom';

function WizardPopup() {

   
    return (
        <>
        { props.wizardIntentType !== null && <Redirect to="/home/auto-wizard" /> }

        <Row style={{height: window.innerHeight}} className="d-flex">
            <div className="mt-5 mx-auto wizard-popup d-flex flex-column">
                <Row className="my-auto">
                    <Col lg={2} />

                    <Col>
                        {/* <Link to="/home/auto-wizard" style={{textDecoration: 'none'}} onClick={() => setWizardIntentType('default')}> */}
                            <div className="m-auto wizard-popup-btn d-flex" onClick={() => setWizardIntentType('default')}>
                                <p className="m-auto">Specific postâ€™s comment</p>
                            </div>
                        {/* </Link> */}
                    </Col>

                    <Col lg={2} />
                </Row>
                
                <Row className="my-auto">
                    <Col lg={2} />

                    <Col>
                        {/* <Link to="/home/auto-wizard" style={{textDecoration: 'none'}} onClick={() => setWizardIntentType('generic')}> */}
                            <div className="m-auto wizard-popup-btn d-flex" onClick={() => setWizardIntentType('generic')}>
                                <p className="m-auto">Generic intents</p>
                            </div>
                        {/* </Link> */}
                    </Col>

                    <Col lg={2} />
                </Row>

            </div>
        </Row>
        </>
    );
}



const mapStateToProps = (state) => ({
    wizardIntentType: state.wizardR.wizardIntentType,
})

export default connect(mapStateToProps, {setWizardIntentType})(WizardPopup)
